Opis:
Dear GREENO2 Friends,
Wishing you all an extraordinary 2024 filled with inspiration and success! 🌿 We're thrilled to share our commitment to the GREENO2 project, coordinated by the University of TUSCIA and co-financed by the Erasmus+ program.
GREENO2 aims to transform higher education institutions into sustainable centers for research, participation, environmental awareness, and oxygen generation. 🌍 Over the next three years, we will promote solutions for both vertical and horizontal greenery, actively engaging the academic community in environmental conservation and enhancing well-being in higher education.
Online education will play a pivotal role in increasing environmental awareness through the practice of "green roofs" and sustainable solutions. Recognizing the pivotal role of universities in fostering sustainable development and addressing climate change, GREENO2 is dedicated to turning green roofs into spaces for research, participation, and environmental awareness, involving university staff and students actively.

The recent kickoff meeting in Athens was a success, with a multidisciplinary partnership from various nations. This collaboration between universities, non-profit organizations, and businesses is a significant step toward achieving our common goals.
With confidence, we look ahead to the next 36 months, during which we will work together to turn GREENO2's vision into reality. Wishing you all a year full of inspiration, innovation, and success. 🌱
